import React, { useState, useEffect } from 'react';

function App() {
  const [dat, setData] = useState([]);

  useEffect(() => {
    fetch("/members")
      .then(res => res.json())
      .then(data => {
        setData(data.members);
        console.log(data);
      })
      .catch(error => {
        console.error("Error:", error);
      });
  }, []);

  return (
    <div>
      <h1>Members:</h1>
      <ul>
        {dat.map((member, index) => (
          <li key={index}>{member}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
